import React from "react";
import Movie from "./Movie";

const Results = (props) => {
  return (
    <div>
        {props.movies.map(t => {
          return <Movie details = {t} />
        })}
        {/* {console.log(props.movies)} */}
    </div>  
  );
};

export default Results;
